import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import AppBar from '@mui/material/AppBar';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import ExitToAppIcon from '@mui/icons-material/ExitToApp'; // Import ExitToAppIcon
import { Link, useHistory } from 'react-router-dom'; // Import useHistory

const drawerWidth = 240;

export default function Navbar() {
  const history = useHistory(); // Initialize useHistory

  const handleLogout = () => {
    // Implement logout functionality here, such as clearing session or token
    // Example: sessionStorage.clear(); // Clear session storage
    history.push('/signin'); // Navigate to signin page after logout
  };

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <Typography variant="h4" noWrap component="div">
            Welcome to The Admin Panel
          </Typography>
          <IconButton
            edge="end"
            color="inherit"
            aria-label="logout"
            onClick={handleLogout}
            sx={{ ml: 'auto' }} // Move the logout button to the right
          >
            <ExitToAppIcon />
          </IconButton>
        </Toolbar>
      </AppBar>
      {/* Rest of your code */}
    </Box>
  );
}
